10001	\N	2	10000	nhat.nguyen@dinosys.vn	\N	nhat.nguyen@dinosys.vn	10001	As a product owner, I'd like to express work in terms of actual user problems, aka User Stories, and place them in the backlog >> Try creating a new story with the "+ Create Issue" button (top right of screen)	When you click "+ Create Issue" you will be asked for the correct project (select "test") and Issue Type (select "Story").\n\n*About User Stories*\n\nThe Scrum methodology drops traditional software requirement statements in favour of real world problems expressed as User Stories. Stories describe the task a particular user is trying to achieve and its value. They are typically of the form "As a (role) I want (something) so that (benefit)". This approach focuses the team on the core user need rather than on implementation details. \n\nStories are "placeholders for a conversation" -- they do not need to be especially detailed since it is expected that the team will work together to resolve ambiguity as the story is developed. \n\nStories to be implemented in the future are stored in the Product Backlog. The backlog is ranked by the Product Owner so that the next items to be completed are at the top.	\N	3	\N	10000	2017-11-01 10:20:03.821+00	2017-11-01 10:20:03.821+00	\N	\N	0	0	\N	\N	\N	10001	\N	\N	\N
